import React, { Component } from 'react';

class Data extends Component {
    state = { 
        loading: true,
        plants: [],
     }

    componentDidMount() {
        fetch("https://herbarium-map-server.herokuapp.com/herbarium")
        .then((response) => response.json())
        .then((data) => {
            this.setState({
                plants: data
            })
        })
     }

    render() { 
        return <div>
            {<div>{this.state.data[0]}</div>}
        </div>;
    }
}

export default Data;
